import ProjectCard from "./ProjectCard";

function Projects() {
  const projects = [
    {
      title: "Tic-Tac-Toe",
      description: "Classic game built with React & Tailwind.",
      github: "#",
      demo: "#"
    },
    {
      title: "Portfolio",
      description: "Ultra-animated portfolio with Ben 10 vibes.",
      github: "#",
      demo: "#"
    }
  ];

  return (
    <section id="projects" className="py-20 px-4 max-w-7xl mx-auto">
      <h2 className="text-4xl font- text-omnitrixGreen text-center mb-12">Projects</h2>
      <div className="grid md:grid-cols-2 gap-8">
        {projects.map((proj, i) => <ProjectCard key={i} {...proj} />)}
      </div>
    </section>
  );
}

export default Projects;
